import React, { Component } from "react";
class User extends Component {
  render() {
    state = {
      count: 12,
    };
    return (
      <div>
        <h1>{this.state.count}</h1>
        <ul>
          <li>姓名：{this.props.user.name}</li>
          <li>年龄：{this.props.user.age}</li>
        </ul>
      </div>
    );
  }
}

export default User;
